import manageJss from "@microsoft/fast-jss-manager-react";
import { ProgressStyles } from "@microsoft/fast-components-styles-msft";
import MSFTProgress, { ProgressSize, } from "./progress";
import progressSchema from "./progress.schema";
/*
 * The type returned by manageJss type is very complicated so we'll let the
 * compiler infer the type instead of re-declaring just for the package export
 */
/* tslint:disable-next-line:typedef */
const Progress = manageJss(ProgressStyles)(MSFTProgress);
export { Progress, progressSchema, ProgressSize, };
